class User {
    constructor(login, password, isLogged) {
        this.login = login
        this.password = password
        this.isLogged = isLogged
    }

    set isLogged(isLogged) {
        return this.isLogged = isLogged
    }

    get login() {
        return this.login
    }

    get password() {
        return this.password
    }
}

export default User
